import sys
import base64
import tempfile
import os
from PyQt6.QtWidgets import *
from PyQt6.QtMultimedia import QMediaPlayer, QAudioOutput
from PyQt6.QtCore import QUrl

# --- ここに音源データ（base64文字列）を貼り付けてください ---
BGM_DATA = b"""

"""

def extract_bgm_to_tempfile():
    """base64のBGMデータを一時ファイルに展開し、パスを返す"""
    temp = tempfile.NamedTemporaryFile(delete=False, suffix=".mp3")
    temp.write(base64.b64decode(BGM_DATA))
    temp.close()
    return temp.name

def setup_player(bgm_path):
    """QMediaPlayerとQAudioOutputをセットアップし、BGMを再生する"""
    player = QMediaPlayer()
    audio_output = QAudioOutput()
    player.setAudioOutput(audio_output)
    player.setSource(QUrl.fromLocalFile(bgm_path))
    audio_output.setVolume(0.5)
    player.setLoops(QMediaPlayer.Loops.Infinite)
    player.play()
    return player, audio_output

class MusicPlayer(QWidget):
    def __init__(self):
        super().__init__()
        self.setWindowTitle("BGMプレイヤー")
        self.setGeometry(200, 200, 300, 120)

        # ボタン
        self.play_btn = QPushButton("再生", self)
        self.pause_btn = QPushButton("一時停止", self)
        self.play_btn.setEnabled(False)   # ← 最初は再生中なので無効
        self.pause_btn.setEnabled(True)   # ← 最初は一時停止だけ有効

        # レイアウト
        layout = QVBoxLayout()
        layout.addWidget(self.play_btn)
        layout.addWidget(self.pause_btn)
        self.setLayout(layout)

        # BGM準備
        self.bgm_path = extract_bgm_to_tempfile()
        self.player = QMediaPlayer()
        self.audio_output = QAudioOutput()
        self.player.setAudioOutput(self.audio_output)
        self.player.setSource(QUrl.fromLocalFile(self.bgm_path))
        self.audio_output.setVolume(0.5)
        self.player.play()  # ← ここで最初から再生

        # ボタンイベント
        self.play_btn.clicked.connect(self.play_music)
        self.pause_btn.clicked.connect(self.pause_music)

    def play_music(self):
        self.player.play()
        self.play_btn.setEnabled(False)
        self.pause_btn.setEnabled(True)

    def pause_music(self):
        self.player.pause()
        self.play_btn.setEnabled(True)
        self.pause_btn.setEnabled(False)

    def closeEvent(self, event):
        # 終了時に一時ファイルを削除
        if hasattr(self, "bgm_path") and os.path.exists(self.bgm_path):
            os.remove(self.bgm_path)
        event.accept()

if __name__ == "__main__":
    import sys
    app = QApplication(sys.argv)
    window = MusicPlayer()
    window.show()
    sys.exit(app.exec())